import React from 'react'
import Navbar from '../layouts/navbar'
import Pages from '../layouts/page';
import {BrowserRouter as Router } from "react-router-dom";


const  main = () => {
    return (
        <div className="main">
            <Router>
                <Navbar/> 
                <Pages/>
            </Router>
        </div>
    )
}

export default main;
